import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [farmacia, setFarmacia] = useState([])

  async function fetchFarmaciaData(){
    try {
      const {data} = await axios.get("localhost:3000/produtos").json()
      setFarmacia(data)
    } catch (error) {
      console.error(error)
    }
  }

  useEffect(()=>{
    fetchFarmaciaData()
  }, [])

  return (
    <div>
      {farmacia.map((farmacia)=>{
        <p>{farmacia.nome}</p>
})}
    </div>
  );
}

export default App;
